INSERT INTO `abouts` (`id`, `image`, `description1`, `description2`, `promise`, `created_at`, `updated_at`) VALUES
(1, 'EZRkeLxANscYkCry8Pz13z9FqqxreYWaG4tqozS1.png', 'Dr Sherine El Shimi is a certified clinical nutritionist and has completed her MSc in clinical nutrition with a specialty in nutrition for cancer from the University of Roehampton in the U.K. Sherine is exceptional in dealing with diabetes,high blood pressure , autoimmune diseases and digestive issues.\r\nShe has been working with patients both adults and children since 2013 in both clinical nutrition and obesity with clear results.\r\nHer deepest satisfaction comes when there are clear results in weight loss and a significant  change in habits and improvement in quality of life.\r\nDr Sherine is a graduate of the faculty of medicine. She has always had a passion for nutrition and started her internship early on while she was still in university in both Egypt and the U.K at Guys and St Thomas hospital.\r\nShe has also completed a diploma in Public health nutrition and has worked with UNICEF in tackling obesity in Egypt.She has worked with several multinational companies to help launch healthy products as well.\r\nShe has also worked with schools in Egypt to improve the quality of food and design healthy and nutritious menus and has offered educational courses for children to explain the benefits of healthy eating.', 'It was very obvious for me that the right nutrients can help the body in many different ways.\r\nI have been working in the field of clinical nutrition for over ten years and I’m very excited to share my experience with you.\r\nNutriTribe offers customized tailor-made packages to different individuals according to their needs, so whether you’re a new mum or you’d like to heal your chronic illness or you’re in need to lose a few kilos, we have the package for you.\r\nWe know that there isn’t one diet that fits all, and we are passionate about offering you an array of healthy recipes and meal preparation techniques so that you can save time and make better health choices in the future.\r\nWe are here to support you throughout your health and wellness journey with easy quick steps, answering all your questions through WhatsApp and Facebook and introducing you to your nutrition community.\r\nWe can’t wait to start this journey together!', 'At NutriTribe we are passionate about tailoring and customizing our different nutrition packages to your individual needs.\r\nWe believe in meeting you where you are and taking you to where you want to be and that is key in order to embrace a healthy lifestyle by going through the obstacles of the mindset together and gently shifting both attitude and perspective so that you can ROCK your health and nutrition goals.', '2020-06-10 21:54:49', '2020-06-19 03:02:20');
