INSERT INTO `blogs` (`id`, `image`, `title`, `slug`, `description`, `tags`, `share`, `created_at`, `updated_at`) VALUES
(5, 'vEjmJvXlWZgBbRE1oB7tYDg0zMD647w5uIOWdcvw.png', 'Tips from my fridge', 'tips-from-my-fridge', '<p><strong><u>Tips from my fridge</u></strong></p>\r\n<p>We know that when you find yourself really hungry you want to grab the nearest most convenient meal that you can find. You won&rsquo;t wait until you chop that cucumber or make the fruit salad or cook the grilled chicken. You will probably reach for the chips or the box of chocolate chip cookies.</p>\r\n<p>Which is fine until you realize that the one thing holding you back from reaching your health and nutrition goals is planning.</p>\r\n<p>Believe it or not planning is key to a healthy body. When you&rsquo;re full on hungry you won&rsquo;t think of making the salad, so the salad has to be prepared in advance in case the hunger pangs strike.</p>\r\n<p>So here are some tips to set the tone for meal prepping and to make sure you&rsquo;re fully stocked in terms of healthy and nutritious items.</p>\r\n<p><strong>1-Have a full fresh produce drawer:</strong></p>\r\n<p>&nbsp;Making sure your fridge is stocked which fresh chopped fruits and vegetables that are in season will save you a lot of hassle. I recommend following the grocery list in your meal plan and buying once a week, wash everything and store in the fridge. In case you don&rsquo;t have time, you can chop it and put them in the freezer for the following week.</p>\r\n<p>&nbsp;<strong>2-Whenever you get the chance chop the produce:</strong></p>\r\n<p><strong>&nbsp;</strong>To make life easier, grab the cucumbers, tomatoes, lettuce and all the greens like kale, arugula and any other type of lettuce and chop them and put them in boxes for later. This will definitely save you a lot of time in the future.</p>\r\n<p>&nbsp;<strong>3-Don&rsquo;t buy Mayo! Simply it&rsquo;s calories you don&rsquo;t need:</strong></p>\r\n<p>&nbsp;Yes, Mayo has a lot of calories in one spoon and it&rsquo;s also loaded with so much unhealthy fat. For a healthier alternative you can mix Greek yoghurt with garlic and little dash of olive oil.</p>\r\n<p><strong>4-Same as Ketchup (the amount of added sugar is unreal):</strong></p>\r\n<p>&nbsp;I don&rsquo;t like to be the bearer of bad news but one tablespoon of ketchup has around 17 calories and 3.6 g of sugar! Image if you add 5 tablespoons which is average for one meal is almost 18 grams of sugar.</p>\r\n<p><strong>5-Try to make your tomato sauce at home, the supermarket version has so much added sugar.</strong></p>\r\n<p>It&rsquo;s super easily if you decide that you will make tomato sauce at home, you can boil the tomatoes, put them in cold water after, peel the skin, blend them then drain them to make sure there are no seeds left.</p>\r\n<p>Then freeze the batch which you can use later for so many things.</p>\r\n<p><strong>6-No need for Juice or Soda drinks it&rsquo;s better to eat your calories rather than drink them:</strong></p>\r\n<p>It&rsquo;s so much healthier if you eat the fruit itself as it is full of fiber and will keep you full for longer, if you have juice instead it will be loaded with sugar even if it&rsquo;s the natural kind.</p>\r\n<p>Soda on the other hand is full of sugar, it has around 39 grams of added of sugar which is around 10 teaspoons!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'tips,fridge,produce drawer,my pantry', 55, '2020-06-15 04:12:26', '2020-06-17 04:51:07'),
(6, 'vy8GVhTkil4E3HuyPECTUBhNxQE0DtZBr0GSeqy2.png', 'The Keto Diet', 'the-keto-diet', '<p>The keto diet has gained a lot of popularity during the last few years. It is a high fat, low carb diet. It has several benefits against diabetes, cancer and epilepsy</p>\r\n<p>The diet works with the metabolic pathway of <strong>ketosis</strong> which burns fat and turns ketones in the liver to supply the brain.</p>\r\n<p>It causes massive decrease in blood sugar level and insulin production.</p>\r\n<p>This diet is perfect for someone that doesn&rsquo;t like to restrict calories or count calories, it also has several benefits for diabetes and pre diabetes. In a study done for diabetic patients, it found that 95.2% where able to reduce medications in comparison to 62% that were on a restricted diet.</p>\r\n<p><strong><u>The ketogenic diet has several benefits regarding </u></strong></p>\r\n<p>1) Diabetes and pre diabetes</p>\r\n<p>2 )PCOS</p>\r\n<p>3) Epilpsey and Alzehemier</p>\r\n<p>4) It has also improved HDL and triglycerides</p>\r\n<p>&nbsp;<strong><u>What are the food items that should be included?</u></strong></p>\r\n<p>1) Fish, salmon</p>\r\n<p>2) Meat and chicken</p>\r\n<p>3) Eggs</p>\r\n<p>4) Butter and cream</p>\r\n<p>5) Low carb veggies: pepper- onions &ndash; greens</p>\r\n<p>6) Healthy oils</p>\r\n<p>7) Nuts and seeds</p>\r\n<p>8) Cheese</p>\r\n<p>9) Avocados</p>\r\n<p>10)Condiments</p>\r\n<p>To learn more stay tu</p>', 'keto,diet', 11, '2020-06-15 04:36:06', '2020-06-19 17:48:29'),
(7, 'TspoGt1wIOdl4IOm5c6obYmYEPY0e3mYumExwUq2.png', 'Intermittent Fasting', 'intermittent-fasting', '<p>Intermittent fasting is getting a lot of hype these days, I wanted to break it down and explain the how it works, let&rsquo;s get started!</p>\r\n<p><strong>What is intermittent fasting?</strong></p>\r\n<p>It&rsquo;s basically eating over a short period of time, to minimize the amount of calories that you eat, and to optimize hormones which control body weight</p>\r\n<p><strong>How can I start?</strong></p>\r\n<p>There are three types of intermittent fasting</p>\r\n<p>1-16/8 method: which is skipping breakfast and eating from 12 noon until 8 pm</p>\r\n<p>2-Eat stop Eat: you stop eating after having dinner until dinner the next day.</p>\r\n<p>3-5:2 diet: eating only 500 calories twice a week and eating normally the rest of the week.</p>\r\n<p><strong>How does intermittent fasting work?</strong></p>\r\n<p>When you&rsquo;re fasting, the body works in a different way.</p>\r\n<p>1-Insulin: the body produces less insulin during fasting.</p>\r\n<p>2- Human Growth hormone: during fasting the body produces 5 times the amount of growth hormone.</p>\r\n<p>3-Norepinephrine: the nervous system sends signals to the body to break fat cells into three fatty acids.</p>\r\n<p>&nbsp;It has been proven that intermittent fasting helps in reducing<strong> body weight 3-8 % over a period of 3-24 weeks. </strong>It also reduces weight circumference and it helps in not restricting the type of food which is consumed.</p>\r\n<p>Of the many benefits of intermittent fasting, it also helps to hold on to the <strong>body&rsquo;s muscle mass.</strong></p>\r\n<p>In order to win and reach your health and nutrition goals with intermittent fasting. <strong>You need to still choose healthy options, count your calories and have patience and consistency.</strong></p>\r\n<p>Join our summer express program to learn more about intermittent fasting.</p>', 'Intermittent,Fasting', 11, '2020-06-15 04:40:07', '2020-06-21 22:34:21'),
(8, '2fcmEc8wT3NpyE8oi0WwXQq9rIO4T3meMytcdyRS.png', 'Tips from my pantry', 'tips-from-my-pantry', '<p>if you&rsquo;re busy and the go, whether you&rsquo;re late for work or trying to juggle making breakfast for your family. There are a few life savers that you need in your pantry so that you can easily reach your health and nutrition goals.</p>\r\n<p>&nbsp;<strong><u>1-Team oats:</u></strong></p>\r\n<p>&nbsp;Oats are really nutritious as a grain. If you buy a good kind of oats, they are gluten free, lower in calories than cereal, they have no added sugars and they will keep you full for a long time. It is also a staple in my family as it can be used for adults and even toddlers.</p>\r\n<p>&nbsp;<strong><u>2-Freekeh:</u></strong></p>\r\n<p>In my packages you will find that I am freekeh biggest fan, I advocate it whenever I can, the reason behind this is that it has 8 grams of protein per one cup which is a lot and only one gram of fat. In comparison to white rice, rice has 30 grams of carbs and around 2.9 grams of protein only.</p>\r\n<p><strong><u>3-Coconut sugar:</u></strong></p>\r\n<p>If you&rsquo;re still confused about making the switch to coconut sugar, let me tell us that has so many benefits. It has a very low GI of only 35 which make it suitable for diabetes.</p>\r\n<p>It also has inulin which balances blood sugar and keeps your gut healthy.</p>\r\n<p><strong><u>5-Brown rice: </u></strong></p>\r\n<p>Brown rice contains more fiber than white rice and will keep you full for much longer, it also has less calories than white rice.</p>\r\n<p><strong><u>6-Oat flour:</u></strong></p>\r\n<p>Oat flour has a lot more protein and essential fats. It is also packed with antioxidants. One cup is packed with manganese and phosphorus.</p>\r\n<p><strong><u>7-Olive oil:</u></strong></p>\r\n<p>Olive oil is by far the healthiest oil on earth, It has almost 9% of MUFA (mono-unsaturated fatty acids) and it&rsquo;s also loaded with antioxidants and has really high boiling point in comparison to other oils.</p>', 'tips,pantry', 95, '2020-06-15 22:55:59', '2020-06-22 01:35:56');
