(2, 'I’ve Started Diets Before And Lost Some Weight But Sooner Or Later I Go Back To My Old Ways. How Come This Time Will Be Different?', 'At Nutritribe We Work Together On Changing The Mindset,Attitude And Thoughts So That They Would Reflect On Your Habits And Then The Real Change Happen. We Work Step By Step And As Per Our Testimonials We Never Push,We Just Take You From Where You Are To Where You Want To Be. At NutriTribe We Work Together On Changing The Mindset, Attitude And Thoughts So That They Would Reflect On Your Habits And Then The Real Change Happens. We Work Step By Step And As Per Our Testimonials We Never Push, We Just Take You From Where You Are To Where You Want To Be So That Your Health And Weight Loss Goals Will Be Reached.', '2020-06-14 08:50:54', '2020-06-15 22:38:32'),
(3, 'I Know That Being Healthy Is All About Going Organic, Gluten Free But I’m Not Ready To Do That. Can I Still Start On One Of Your Packages?', 'Absolutely You Don’t Have To Do Anything You’re Uncomfortable With. We Don’t Encourage A Drastic Change In Lifestyle. We Recommend A Step By Step Approach.', '2020-06-14 08:51:32', '2020-06-14 08:51:32'),
(4, 'I’ve Never Exercised Before Can I Still Start?', 'Definitely Starting Is The First Step And We Promise The First Exercises Sent Will Be Relatively Easy.', '2020-06-14 08:51:52', '2020-06-14 08:51:52'),
(5, 'I’ve Never Done A Cleanse Before And I’m Worried I Will Get Dizzy Or Tired. How Will You Support Me?', 'Before Starting Our Cleanse, We Initiate The Body By Our 3- Day Pre-Cleanse Then The Program Begins. We Support You Throughout The Program With Our WhatsApp And Facebook Group', '2020-06-14 08:52:13', '2020-06-14 08:52:13');
