(14, 'mohamed elbiheiry', 'elbiheiry2@gmail.com', 'test', 'test', '01011093385', '123456789', '{\"5\":{\"id\":\"5\",\"name\":\"Feel Good Now!\",\"price\":6000,\"quantity\":1,\"attributes\":[],\"conditions\":[],\"associatedModel\":{\"id\":5,\"image\":\"pqRpcD3zOggX6ygReKE1PrLIKumgtvqY7NM3QBxw.png\",\"name\":\"Feel Good Now!\",\"slug\":\"feel-good-now\",\"egp_price\":\"6000\",\"usd_price\":\"370\",\"uae_price\":\"1360\",\"eur_price\":\"330\",\"description\":\"Do you feel stuck in a loop of crash- dieting?\\r\\nDo you eat clean for a week and then go back to your usual habits?\\r\\nAre you fed up from this never- ending cycle?\\r\\nThen this is the package for you!\\r\\nAre you ready to take self-care and motivation to a whole new level?\\r\\nFind out how you can change your habits without strict dieting. Go back to your ideal weight and shape whilst learning new habits that will last way beyond the three months of our work!\",\"features\":\"1-Six tailor-made meal plans\\r\\n2- 15 quick & easy recipes\\r\\n3- One hour live weekly for your questions through WhatsApp\\r\\n4- Bi-weekly call for 20 minutes\\r\\n5- Weekly check-ins via email through our tracking sheet\\r\\n6- Group support through our Facebook group\",\"benefits\":\"1-Getting back in shape and LOSING weight\\r\\n2- Better sleep\\r\\n3- Mood improvement\\r\\n4- Change of habits at YOUR pace\\r\\n5- Start exercising and getting into shape\\r\\n6- Getting your energy back!\",\"requirements\":\"1- Initial Lab tests\\r\\n2- Commitment to the plan\\r\\n3- Weekly check-ins and passing the biweekly gate\",\"category_id\":3,\"show_in_booking\":1,\"created_at\":\"2020-06-10T16:56:47.000000Z\",\"updated_at\":\"2020-06-15T16:24:52.000000Z\"}},\"11\":{\"id\":\"11\",\"name\":\"Immunity Cleanse\",\"price\":3000,\"quantity\":1,\"attributes\":[],\"conditions\":[],\"associatedModel\":{\"id\":11,\"image\":\"bcTXOd8KnWx60ATHEjXuIfmBx2JZpsRrSLdSOBCv.png\",\"name\":\"Immunity Cleanse\",\"slug\":\"immunity-cleanse\",\"egp_price\":\"3000\",\"usd_price\":\"185\",\"uae_price\":\"680\",\"eur_price\":\"165\",\"description\":\"-\",\"features\":\"1-  10 healthy recipes\\r\\n2-  Meal plan and menu for the seven days\\r\\n3-  Live chat for one hour on the second day of the cleanse for all your questions\\r\\n4-  Complete detailed grocery shopping list\\r\\n5-  Healthy cooking tips  Free follow-up post cleanse\",\"benefits\":\"1- Boosting your immunity\\r\\n2-  Better sleep\\r\\n3-  Losing 5 kilos\\r\\n4-  Tracking your hydration\\r\\n5-  Healthy recipes\\r\\n6-  Removing gluten, dairy and refined flour for seven days\",\"requirements\":null,\"category_id\":2,\"show_in_booking\":0,\"created_at\":\"2020-06-15T05:43:55.000000Z\",\"updated_at\":\"2020-06-16T02:39:49.000000Z\"}}}', '2020-06-16 14:18:52', '2020-06-16 14:18:52'),
(15, 'mostafa samy', 'elbiheiry2@gmail.com', 'Alexandria', 'test', '01011093385', '12345', '{\"9\":{\"id\":\"9\",\"name\":\"Pre-Baby Detox\",\"price\":245,\"quantity\":1,\"attributes\":[],\"conditions\":[],\"associatedModel\":{\"id\":9,\"image\":\"bd6VZGRSrV0fYEroLvY7JFf0jFy6vgT9iWIdHCE5.png\",\"name\":\"Pre-Baby Detox\",\"slug\":\"pre-baby-detox\",\"egp_price\":\"4000\",\"usd_price\":\"245\",\"uae_price\":\"908\",\"eur_price\":\"220\",\"description\":\"Are you planning to conceive but lost with all the information out there?\\r\\nAre you tired of listening to advice from family and friends?\\r\\nThis plan is your \\u2018go-to\\u2019 for all your questions about the right nutrition and supplements for conceiving.\",\"features\":\"1-  Necessary Lab tests\\r\\n2-  Simple healthy meal plan focusing on ingredients that increase\\r\\nfertility\\r\\n3-  Recommended vitamins and supplements that help with fertility\\r\\n4-  Simple and easy recipes (not more than 20 minutes to make)\\r\\n5-  Bi-weekly meal plan and call\\r\\n6-  Weekly check-in through email\\r\\n7- Live support on WhatsApp once a week.\",\"benefits\":\"1- Following a beneficial meal plan with healthy ingredients\\r\\n2-  Feeling energized, healthy, as well as sleeping better\\r\\n3-  Education and knowledge about fertility\",\"requirements\":\"1-  This is suitable three months before planning to conceive (minimal PCOS and endometriosis)\\r\\n2-  The appropriate Lab tests done\\r\\n3-  Commitment and weekly check-ins\",\"category_id\":2,\"show_in_booking\":1,\"created_at\":\"2020-06-10T17:26:48.000000Z\",\"updated_at\":\"2020-06-15T16:25:45.000000Z\"}},\"7\":{\"id\":\"7\",\"name\":\"Clean And Lean\",\"price\":340,\"quantity\":1,\"attributes\":[],\"conditions\":[],\"associatedModel\":{\"id\":7,\"image\":\"WLyyDgOTHuhHSWL1H1Vl91FOUi6IuWimw9LzQvOM.png\",\"name\":\"Clean And Lean\",\"slug\":\"clean-and-lean\",\"egp_price\":\"5500\",\"usd_price\":\"340\",\"uae_price\":\"1247\",\"eur_price\":\"303\",\"description\":\"Are you trying to figure out what \\u2018clean eating\\u2019 is?\\r\\nDo you want to learn about and incorporate \\u2018healthy ingredients\\u2019 in your cooking?\\r\\nAre you confused about organic and non-GMO food?\\r\\nDo you want to improve your overall habits?\\r\\nThen the \\u2018Clean and Lean\\u2019 program is for you.\",\"features\":\"1- One healthy meal plan with a 60-minute phone consultation and questions through email\\r\\n2-  25 recipes which include healthy baking\\r\\n3-  Grocery list\\r\\n4-  Cutting out white flour, sugar and dairy products\\r\\n5-  Joining a \\u2018Clean and Lean\\u2019 support group\",\"benefits\":\"1-  Education about the best nutrition\\r\\n2-  Learning new and healthy recipes\\r\\n3-  Losing weight while eating healthy and nutritious meals\",\"requirements\":null,\"category_id\":2,\"show_in_booking\":1,\"created_at\":\"2020-06-10T17:22:09.000000Z\",\"updated_at\":\"2020-06-15T16:25:36.000000Z\"}}}', '2020-06-24 10:35:13', '2020-06-24 10:35:13'),
