(17, 'Abdelaziz Gamal', 'zeezo.gamal@gmail.com', 'Cairo', 'Test', '01210224040', '00000', '{\"11\":{\"id\":\"11\",\"name\":\"Immunity Cleanse\",\"price\":185,\"quantity\":1,\"attributes\":[],\"conditions\":[],\"associatedModel\":{\"id\":11,\"image\":\"bcTXOd8KnWx60ATHEjXuIfmBx2JZpsRrSLdSOBCv.png\",\"name\":\"Immunity Cleanse\",\"slug\":\"immunity-cleanse\",\"egp_price\":\"3000\",\"usd_price\":\"185\",\"uae_price\":\"680\",\"eur_price\":\"165\",\"description\":\"-\",\"features\":\"1-  10 healthy recipes\\r\\n2-  Meal plan and menu for the seven days\\r\\n3-  Live chat for one hour on the second day of the cleanse for all your questions\\r\\n4-  Complete detailed grocery shopping list\\r\\n5-  Healthy cooking tips  Free follow-up post cleanse\",\"benefits\":\"1- Boosting your immunity\\r\\n2-  Better sleep\\r\\n3-  Losing 5 kilos\\r\\n4-  Tracking your hydration\\r\\n5-  Healthy recipes\\r\\n6-  Removing gluten, dairy and refined flour for seven days\",\"requirements\":null,\"category_id\":2,\"show_in_booking\":0,\"created_at\":\"2020-06-14T20:43:55.000000Z\",\"updated_at\":\"2020-06-15T17:39:49.000000Z\"}}}', '2020-06-25 15:50:05', '2020-06-25 15:50:05');
