(3, '1oYIVYko1A0pSaH3DS34M8VLujZVpY3vL2mihV01.png', 'Mummy-To-Be!', 'mummy-to-be', '2340', '150', '549', '124', 'Congratulations Mummy-To-Be! Would love to be there and assist you on your journey to motherhood :-)\r\nAre you looking for a way to stay fit and gain the exact required weight monthly?\r\nDo you want to feel good and fight cravings and fatigue?\r\nWell then, ‘Mummy-To-Be’ is definitely for you!', '6 weeks of healthy meal plans to support YOUR specific needs and bi-weekly phone consultations on Zoom.\r\nMonitoring normal weight-gain\r\nAvoiding unnecessary unhealthy food during pregnancy\r\n Managing cravings\r\nJoining our supportive group of moms-to-be\r\nLearning new healthy recipes\r\nBi-weekly plan and call\r\n Weekly check in via email and live support through WhatsApp twice per week to answer all your questions.\r\n\r\nMeals can delivered to your doorstep at an extra cost', 'Feeling and looking healthy during pregnancy\r\nFollowing a safe exercise plan to support your nutrition\r\nOverall well being', 'Normal pregnancy without complications\r\nCommitment via weekly check ins', 6, 3, 1, '2020-06-10 14:53:12', '2021-05-06 19:47:12'),
(4, 'nc5eOOpS3IIurpOK2gmQgk6jYJXRmUJqbE0tOGxC.png', 'FitMom', 'fitmom', '2340', '150', '549', '124', 'We know you don’t have a free second to yourself these days and you probably don’t even have time to read this intro! But we promise: We’ll make it worth your while!\r\nIt’s time to take care of YOU!\r\nYou need to eat healthy and exercise so you can increase your energy level as well and get back to the shape you desire.\r\nlet’s start today!', '6 weeks of healthy meal plan and easy to do recipes and bi-weekly online consultation on zoom .\r\nSupport through our Facebook group\r\nLive answers to your questions (answering any of your questions, and support while breastfeeding) through our WhatsApp group twice per week.\r\nEasy quick recipes and snacks\r\nAdvice about meal prepping', 'Losing weight and getting your energy back\r\n Better sleep\r\n Avoiding unhealthy meals\r\n Learning new habits and letting go of harmful habits\r\nToning from exercise\r\nSupport and feeling like part of a community', 'Initial Lab tests\r\n Commitment and motivation through our bi-weekly calls and weekly emails', 6, 3, 1, '2020-06-10 14:54:59', '2021-05-06 19:49:04'),
(5, 'pqRpcD3zOggX6ygReKE1PrLIKumgtvqY7NM3QBxw.png', 'Feel Good Now!', 'feel-good-now', '2340', '150', '549', '124', 'Do you feel stuck in a loop of crash- dieting?\r\nDo you eat clean for a week and then go back to your usual habits?\r\nAre you fed up from this never- ending cycle?\r\nThen this is the package for you!\r\nAre you ready to take self-care and motivation to a whole new level?\r\nFind out how you can change your habits without strict dieting. Go back to your ideal weight and shape whilst learning new habits that will last way beyond the three months of our work!', 'Healthy meal plan and easy to do recipes for 6 weeks. \r\n15 quick & easy recipes\r\nOne hour live weekly for your questions through WhatsApp\r\nOnline consultation on Zoom bi-weekly \r\n Weekly check-ins via email through our tracking sheet\r\nGroup support through our Facebook group\r\nBonus beginners exercise sheet', 'Getting back in shape and LOSING weight\r\n Better sleep\r\nMood improvement\r\nChange of habits at YOUR pace\r\nStart exercising and getting into shape\r\nGetting your energy back!', 'Initial Lab tests\r\nCommitment to the plan\r\nWeekly check-ins and passing the biweekly gate', 12, 3, 1, '2020-06-10 14:56:47', '2021-11-10 22:24:01'),
(6, 'IRs2dcYCft9F28M58FzIhNDHVhKwFTCfTo9w75l6.png', 'Body For Life', 'body-for-life', '2340', '150', '549', '124', 'Are you suffering from a chronic illness such as\r\ndiabetes, hypertension, or autoimmune disease? Did you know that proper nutrition can help you feel better and, in some cases, can decrease the need for medication?\r\nIf you are passing through any medical difficulties and want\r\nprofessional guidance through nutrition and healthy habits, then this is the best plan for you.', '1  personal online consultation on Zoom to discuss your customized nutritional plan, which will entail all the food items that your body and mind can benefit from.\r\n6 weeks of healthy meal plans and support through email.\r\nAnswering all your questions weekly through our live hour\r\non WhatsApp.', 'Feeling better and more energized\r\n Understanding how nutrition can help and support your illness\r\n Feeling more in control of your symptoms', 'Full medical history\r\n Lab tests\r\n Following and committing to the meal plan\r\n Checking in bi-weekly', 12, 3, 1, '2020-06-10 15:06:29', '2021-11-10 22:24:37'),
(8, 'SQJ8P0ybLmc6BJvYVQypVOVlP1FWhqoSJS9cHg7h.png', 'Green Is The New Black', 'green-is-the-new-black', '1040', '67', '244', '55', 'Interested in including more veggies and fruits in your diet but not sure where to start?\r\nWant to cleanse your body and boost your energy levels and immunity\r\nJoin us for three weeks !', 'Online consultation on Zoom to explain the program\r\nThree days pre-cleanse menu to help your body prepare for the cleanse.\r\nFive days cleanse menu with easy to make recipes\r\nThree days after cleanse menu to help reintroduce more food types back to your body\r\nYummy mouthwatering recipes that are super easy to make\r\nDaily online support to help during the cleanse through our WhatsApp group.\r\nLive support on WhatsApp twice per week.\r\nPost cleanse meal plan for ten days.', 'Guaranteed boast to your energy levels.\r\nWeight loss between 5-10 kilos.\r\nImproves immunity\r\nImproves skin\r\nHelps to promote drinking water\r\nGuaranteed decrease in sugar and coffee cravings\r\n Helps improves sleep.', 'Medical History\r\nLab tests', 3, 2, 0, '2020-06-10 15:23:44', '2021-04-28 18:31:11'),
(9, 'bd6VZGRSrV0fYEroLvY7JFf0jFy6vgT9iWIdHCE5.png', 'Pre-Baby Detox', 'pre-baby-detox', '2210', '141', '518', '117', 'Are you planning to conceive but lost with all the information out there?\r\nAre you tired of listening to advice from family and friends?\r\nThis plan is your ‘go-to’ for all your questions about the right nutrition and supplements for conceiving.', '12 Weeks of meal plans, healthy recipes and online consultations on Zoom.\r\nSimple healthy meal plan focusing on ingredients that increase\r\nfertility.\r\nRecommended vitamins and supplements that help with fertility.\r\nSimple and easy recipes (not more than 20 minutes to make)\r\nBi-weekly meal plan and online consultation on Zoom.\r\nWeekly check-in through email\r\nLive support on WhatsApp once a week.', 'Following a beneficial meal plan with healthy ingredients\r\nFeeling energized, healthy, as well as sleeping better\r\nEducation and knowledge about fertility', 'This is suitable three months before planning to conceive (minimal PCOS and endometriosis)\r\n Lab tests done\r\nCommitment and weekly check-ins', 12, 2, 1, '2020-06-10 15:26:48', '2021-04-28 18:29:14'),
(10, 'ewzXx8lxzuS5kV7Brm3JTbtl7uROvXN9vl70eu6c.png', 'Summer Express', 'summer-express', '1560', '100', '366', '83', 'Has the quarantine totally killed your summer body that you were working so hard at achieving?\r\nInterested in getting back to shape ASAP?\r\nAre you the sort of person that loves to try new things?\r\nThen this is the package for you\r\n A combination of tried and tested ways to get the results that you are dreaming of.\r\nReady to join the tribe?\r\nLet’s do this!', 'Three weeks  of intense back to back plans which change every 7 days with an online consultation on Zoom.\r\nYour body will get the chance to experience a certain type of intermittent fasting.\r\nTwo cleanse menus will be done twice during the three weeks with easy to do recipes.\r\nJoin the summer express tribe group on Facebook and WhatsApp for support\r\nLive support twice weekly on WhatsApp to answer all your questions', 'Guaranteed boast to your energy levels.\r\nWeight loss between 5-10 kilos.\r\nImproves immunity\r\nImproves skin \r\nHelps to promote hydration\r\nGuaranteed decrease in sugar and coffee cravings\r\nHelps improves sleep.', 'Medical history\r\nLab tests', 5, 2, 0, '2020-06-10 15:28:51', '2021-05-07 19:05:56'),
(11, 'bcTXOd8KnWx60ATHEjXuIfmBx2JZpsRrSLdSOBCv.png', 'Immunity Cleanse', 'immunity-cleanse', '520', '34', '122', '28', 'By signing yourself up for the seven -day immunity cleanse you’re making your way to a self-care journey that starts by flushing out the toxins in your body so that you can create space for your body to expand and heal.\r\nThis gives a chance for boosting your immunity as well with our smoothie recipes and our super healthy elimination menu.', '10 healthy recipes\r\n Meal plan and menu for the seven days\r\n Live chat for one hour on the second day of the cleanse for all your questions\r\nComplete detailed grocery shopping list\r\nHealthy cooking tips  Free follow-up post cleanse\r\n\r\nAll meals can be delivered to your doorstep at an extra cost', 'Boosting your immunity\r\n Better sleep\r\nLosing 5 kilos\r\nTracking your hydration\r\n Healthy recipes\r\nRemoving gluten, dairy and refined flour for seven days', NULL, 1, 2, 0, '2020-06-15 03:43:55', '2021-04-28 18:25:56'),
(12, 'Pj5WbLelFLaytvWPyB4R3sxI1KiYySniI21ChN1C.png', 'One month Feel Good Now', 'one-month-feel-good-now', '750', '48', '175', '40', 'Two Tailor Made Plans customized to your needs.\r\n\r\nMeal delivery is possible with an extra cost', 'Support on WhatsApp included', 'Weight loss \r\nImproving digestive function\r\nLearning to eat clean nutritious food', NULL, 4, 3, 0, '2021-01-24 20:46:17', '2021-04-28 18:17:10'),
(14, 'OsCnKnd6DzIebgF09rkhfPmjQuZYnHr7JzgP8WVf.png', 'One time online consultation with a meal plan', 'one-time-online-consultation-with-a-meal-plan', '520', '34', '122', '28', 'An one on one online consultation with Dr Sherine  with a detailed meal plan with all the recipes and a follow up online consultation included two weeks after the start of the plan', 'One on  One online consultation through Zoom \r\nA detailed tailor made meal plan with recipes\r\nFollow up consultation included\r\n\r\nNote: Meals can be sent to your doorstep at an extra cost', 'Detailed explanation of your blood test results \r\nDetailed meal plan sent with all the recipes that is tailor made to your needs\r\nFollow up on results two weeks later\r\nSupport through WhatsApp', NULL, 2, 3, 0, '2021-01-25 03:39:09', '2021-04-28 18:12:39'),
(16, 'AYJbfFUnyu0aX0JTtYvcKsosXhPdvUDkPO3RnuNB.png', 'One week meal delivery plan', 'one-week-meal-delivery-plan', '2020', '129', '472', '111', 'Meal delivery plan, with healthy and nutritious food delivered to your door step \r\nThree meals and two snacks per day \r\nLikes and dislikes will be collected through an intake form.', 'Meals will be delivered daily in Zayed and four times a week to other areas in Cairo.\r\nPayment is through the delivery personal and not through the website.', 'Healthy delicious meals delivered to your door step saving time and energy of cooking.', NULL, 1, 3, 0, '2021-11-10 22:38:55', '2021-11-10 22:38:55');
