INSERT INTO `testimonials` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Reem', 'Working with Sherine has been life-saving because she offers a tailored meal plan according to your preferences and lifestyle. Other than losing weight, she helped me develop a healthier lifestyle, so it wasn’t a diet as much as it was a change in my entire eating mentality. Since working with her, I have felt healthier, fitter and most of all, more comfortable with my food choices.', '2020-06-14 08:59:32', '2020-06-14 08:59:32'),
(2, 'Amna', 'The dietary plan and meal options were perfect for me and now, more than 5 years on, I still go back to them for how effective and doable they were. Highly recommend it!', '2020-06-14 08:59:49', '2020-06-14 08:59:49'),
(3, 'Salima', 'Dr. Sherine El Shimi was a very professional practitioner. Her program was always tailored to my needs and likes. I managed to lose all the weight I wanted in a decent amount of time without suffering at all. And I managed to keep that weight, which is the best part of the process :)\r\nShe had patience and listened to all my random questions during the session, which I appreciate a lot.', '2020-06-15 01:44:21', '2020-06-15 01:44:21'),
(4, 'Shady', 'Regarding my nutrition plan with Dr. Sherine El Shimi . My personal experience with Dr. Sherine  I can say surely that she  was a very professional practitioner her program was always tailored to my needs  .I managed to lose all the weight I wanted in a decent amount of time without suffering at all. I followed her plan for several occasions including preparing for my wedding event. She helped me to manage keeping that weight which is the best part of the process:)She had patience and listened to all my random questions during the sessions which I appreciate a lot.', '2020-06-15 01:45:20', '2020-06-15 01:45:20');
